function draw(h, f, e, d, m, k, g)
{
    if (h == "1") {
        i = di
    }
    else {
        if (h == "2") {
            i = ti
        }
        else {
            if (h == "3") {
                i = ci
            }
            else {
                i = mi;
            }
        }
    }
    if (i < e)
    {
        m.beginPath();
        m.strokeStyle = "rgba(0,0,0,1)";
        m.lineTo(f[i], f[i + 1]);
        m.lineTo(f[i + 2], f[i + 3]);
        m.stroke();
        m.lineWidth = g;
        for (var j = 2; j < e; j += d)
        {
            m.beginPath();
            var c = f[i] - f[j];
            var b = f[i + 1] - f[j + 1];
            var a = Math.sqrt(Math.pow(c, 2) + Math.pow(b, 2));
            if (a < k) {
                m.lineTo(f[i], f[i + 1]);
                m.lineTo(f[j], f[j + 1]);
                m.stroke()
            }
        }
        if (h == "1") {
            di += d
        }
        else {
            if (h == "2") {
                ti += d
            }
            else {
                if (h == "3") {
                    ci += d
                }
                else {
                    mi += d
                }
            }
        }
    }
}
